(function() {
  var global;

  global = window;

  Game.prototype.closeView = function() {
    var _this, homepage, replay, share;
    this.hScore = +localStorage.getItem('hScore') || 0;
    if (this.score > this.hScore) {
      this.m_newrecord.play();
      this.hScore = this.score;
      localStorage.setItem('hScore', this.hScore);
    }
    _this = this;
    homepage = $('.end-view .homepage-btn');
    replay = $('.end-view .replay-btn');
    share = $('.end-view .share-btn');
    $('.end-view').addClass('zoomIn animated');
    $('.end-view').show();
    $('.backdrop').show();
    $('.this-score').text(this.score);
    $('.h-score').text(this.hScore);
    replay.off();
    homepage.off();
    replay.one('tap', function() {
      _this.m_btn.play();
      $('.backdrop').hide(200);
      $('.end-view').hide();
      $('.end-view').removeClass('zoomOut zoomIn animated');
      _this.paint();
      return _this.countDown();
    });
    homepage.one('tap', function() {
      _this.m_btn.play();
      $('.backdrop').hide(200);
      $('.end-view').hide();
      $('.end-view').removeClass('zoomOut zoomIn animated');
      _this.paint();
      return _this.homePage();
    });
  };

}).call(this);

